import React from 'react'

const Sidebar = ()=>{
    return (
      <div className='sidebar'>
        <div className='sidebarContent'>
          <div className='bank'>
            <h3>Vietcombank</h3>
            <div className='appendContent'>
              <a src='#'>Chuyển khoản</a>
            </div>
          </div>
        </div>
      </div>
    )
}

export default Sidebar;
